import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Netflix';

import "./App.css";
import Sdata from './Sdata';

ReactDOM.render(

 <>
    <h1 className="heading-1">Top 6 Netflix Series</h1>

    {Sdata.map((val) =>{
       return(
    <Card
       imgsrc={val.imgsrc}
       title={val.title}
       sname={val.sname}
       link={val.link}
    />
       );
    }
    )}

 </>
  ,
  document.getElementById('root')
);
